                      local soakOrder = aura_env.soakOrder[WeakAuras.myGUID]\
                      local playersPerSoak = 20 / (frothCount)\
                      local soakAssignment = math.floor((soakOrder - 1) / playersPerSoak) + 1 -- Soak that you are assigned to stand in (1-5)\
                      \
                      allstates[\"\"] = {\
