                              if strtrim(line):lower() == \"liquidstart\" then\
                                  betweenLine = true\
                              end\
                          end\
                          \
                          -- Parse pop assignments\
                          betweenLine = false\
                          \
                          for line in _G.VExRT.Note.Text1:gmatch(\"[^\\r\\n]+\") do\
                              if strtrim(line):lower() == \"liquidend2\" then\
                                  betweenLine = false\
