                    ["sparkOffsetX"] = 0,
                    ["parent"] = "Vexie Special Bars",
                    ["customText"] = "function()\
                  local power = aura_env.state and aura_env.state.value or 0\
                  local repaired = aura_env.state and aura_env.state.repaired or 0\
                  \
                  return power, repaired > 0 and string.format(\" (+%d)\", repaired) or \"\"\
