                  end\
                  \
                  if WeakAuras.IsOptionsOpen() then\
                      healing = string.format(\"-%d%% heal\", math.random(4) * 25)\
                  end\
                  \
                  if interval == 1 then interval = \"\" end\
                  \
                  if damage and interval and healing then\
                      return damage, interval, damage < 10 and \"M\" or \"\", healing\
                  end\
              end",
